  const props = {
    onClick,
  };

  if(to) {
    props.to = to ;
  } else if(href) {
    props.href = href ;
  }

  const classes = cx('wrapper');
  return (
    <Comp className={classes} {...props}>
      <span>{children}</span>
    </Comp>
  );
}

